import React,{useEffect,useState} from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import IconButton from "@mui/material/IconButton";
import MenuIcon from "@mui/icons-material/Menu";

// import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";

function Items() {

    const [products, setProducts] = useState([]);

    useEffect(() => {
      fetch('https://dummyjson.com/products')
        .then(response => response.json())
        .then(data => setProducts(data.products))
        .catch(error => console.error('Error fetching data:', error));
    }, []);

    console.log(products,'1234')

  return (
    <div className="App" style={{ background: "darkblu" }}>
      <Box sx={{ flexGrow: 1 }}>
        <AppBar position="static" style={{ background: "darkblue" }}>
          <Toolbar variant="dense">
            <IconButton
              edge="start"
              color="inherit"
              aria-label="menu"
              sx={{ mr: 2 }}
            >
              <MenuIcon />
            </IconButton>
            <Typography variant="h6" color="inherit" component="div">
              Food's Restaurant
            </Typography>
          </Toolbar>
        </AppBar>
      </Box>


        {products.map(product => (
          <li key={product.id}>
<Box>{product.brand} </Box>
            <br/>
  <Box> price-{product.price}</Box>

          </li>
        ))}


      <Button variant="contained" style={{ background: "darkblue" }}>Go To Menu</Button>
    </div>
  );
}

export default Items;
